  const data = [
    {
      image: recommend5,
      text: "The best Anti Aging Cream with cheap price",
      buy:"Add Your Bag"
    },
    {
      image: recommend2,
      text: "Best budget Headphone for RPG Gamers",
      buy:"Add Your Bag"
    },
    {
